import React from 'react';

const OcjenaRow = ({
  id,
  ucenik,
  opis,
  datum,
  predmet,
  nastavnik,
  ocjena,
  razred,
}) => {
  return (
    <div>
      <p>ID:{id} </p>
      <p>Ucenik : {ucenik}</p>
      <p>
        {opis}
        {datum} {predmet} {nastavnik} {ocjena} {razred}
      </p>
    </div>
  );
};

export default OcjenaRow;
